import React from "react";
import "./App.css"; // Se houver estilizações
import logo from "./../public/singulAI-logo.png"; // Importando a logo

function App() {
  return (
    <div style={{ textAlign: "center", backgroundColor: "#121212", color: "white", height: "100vh", display: "flex", flexDirection: "column", justifyContent: "center", alignItems: "center" }}>
      {/* Substituindo o foguete pela logo */}
      <img src={logo} alt="Logo SingulAI" style={{ width: "150px", height: "auto", marginBottom: "20px" }} />
      
      <h1 style={{ fontSize: "3rem", fontWeight: "bold" }}>Legado Digital</h1>
      <p style={{ fontSize: "1.5rem" }}>Bem-vindo ao projeto!</p>
      
      <div style={{ display: "flex", alignItems: "center", gap: "10px", marginTop: "20px" }}>
        <input type="text" placeholder="Digite sua carteira" style={{ padding: "10px", fontSize: "16px", borderRadius: "5px", border: "none" }} />
        <button style={{ padding: "10px 20px", fontSize: "16px", backgroundColor: "#ccc", border: "none", borderRadius: "5px", cursor: "pointer" }}>
          Entrar
        </button>
      </div>
    </div>
  );
}

export default App;
